import React from 'react';
import Common from './Common';
import web from '../src/image/img2.jpg';
import web2 from '../src/image/welcome.gif'
// import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
// import '../node_modules/bootstrap/dist/js/bootstrap.min.js';

// <div className='container-fluid nav_bg'>
//     <div className='row'>
//         <div className='col-10 mx-auto'>

//         </div>
//     </div>
// </div>



const Home = () => {
    return (
        <>
            <Common  hname=' G a t e 2022 Result Declared !!' bname='Click here' image={web} pname='more than 30+ students selected'/><br/>
            {/* <p>Welcome</p> */}
            <Common  hname='WELCOME<br> Association of Civil Engineering' bname='Know more about us!' image={web2} pname='Civil Engineering has served mankind since time immemorial. It has been at play since human civilization learnt to build homes, bridges and roads'/>


        </>
    )
}

export default Home;
